goog.provide("goog.dom.pattern.callback.Test");goog.require("goog.iter.StopIteration");goog.dom.pattern.callback.Test=function(){this.matched=!1;this.callback_=null};goog.dom.pattern.callback.Test.prototype.getCallback=function(){if(!this.callback_){this.callback_=goog.bind(function(node,position){this.matched=!0;throw goog.iter.StopIteration},this)}return this.callback_};goog.dom.pattern.callback.Test.prototype.reset=function(){this.matched=!1};